import React from 'react'
import Profile from '../profile/profile';
import Jobs from "../jobs/jobs";
import {Grid} from "@mui/material";

function Layout() {
    return (
        <div>
            <Profile />
            <br />
            <h2>
                RESUME
            </h2>
            <Grid item xs={5}>
                <Jobs JobTitle={'test title'}  JobDuration={'test date'}  JobDepartment={'test Department'}  JobDescription={'test Description'} />

            </Grid>
        </div>
    )
}

export default Layout;
